import recipes from "../data/recipes.json";
import { Filter } from "./filter";

export function Dishes() {
  // display initialState
  return (
    <div className="dishContainer">
      <Filter />
      {recipes.map((recipes) => (
        <div key={recipes.id}>
          <p>{recipes.name}</p>
        </div>
      ))}
    </div>
  );
}
